INSERT INTO `mdl_question` VALUES (1,1,0,'Bild-Frage','<p>Welches Projekt / Unternehmen hat folgendes Logo?</p><p><br></p><p><img src=\"@@PLUGINFILE@@/spring_logo.png\" alt=\"Logo 1\" width=\"280\" height=\"280\" class=\"img-responsive atto_image_button_text-bottom\"><br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost:3000+181013132526+kRLFBK','localhost:3000+181013132714+JPEkJV',0,1539437126,1539437234,2,2,NULL),(2,1,0,'Lernprozess','<p>Wie ist der Lernprozess nach&nbsp;<strong>Brahm &amp; Seufert</strong>&nbsp;aufgebaut?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost:3000+181013132649+qQ0BVq','localhost:3000+190423140131+J92Fsu',0,1539437209,1556028091,2,2,NULL),(3,1,0,'Hick\'s Law','<p>Laut des&nbsp;<strong>Hick\'s Law</strong>&nbsp;steigt die Vorbereitungszeit mit steigender Anzahl an Alternativen. Welcher der folgenden mathematischen Ausdrücke beschreibt dieses Verhalten?<br></p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost:3000+181013132802+3PsLBE','localhost:3000+190423135921+5EkXPD',0,1539437282,1556027961,2,2,NULL),(4,1,0,'Invasive Blutdruckmessung','<p>Welche Aussagen zur invasiven Blutdruckmessung treffen zu?<br></p>',1,'<p><p>zu 1: Der systolische Blutdruck ist in der Körperperipherie (z. B. A. radialis) meist höher als in den großen, herznahen Arterien. Grund dafür sind physiologische Resonanzeffekte, bei denen sich die kardiale und reflektierte Druckwellen überlagern. Zudem können Resonanzeffekte im Messsystem falsch hohe Messwerte erzeugen. Die invasive Blutdruckmessung ist also nicht notwendigerweise genauer als die oszillometrische. Der Einsatz beider Verfahren und ein Vergleich vor allem der ermittelten MAD-Werte kann also auch bei etablierten arteriellen Zugängen nicht schaden.</p><p>zu 2: Richtig ist, dass eine kontinuierliche Spülung erfolgen muss, damit die Kathe3ter nicht zuclotten. Die Systeme sind so konstruiert, dass sie bei einem Druck von ca. 300 Torr ca. 2-4 ml/Stunde spülen. Intermittierende Flushs kommen hinzu. Heparin wird den Spüllösungen standardmäßig NICHT zugesetzt (wegen HIT).</p><p>zu 3: Luftblasen im System dämpfen und ergeben falsch niedrige Messwerte.</p><p>zu 4:Bei flacher Rückenlage wird der Nullabgleich auf Höhe des rechten Vorhofs vorgenommen. Wer es ganz genau machen will, was vor allem wichtig ist, wenn man auch eine Referenz für den ZVD oder PAP braucht nimmt als Bezugshöhe 2/5 der Distanz zwischen Sternum und Auflagefläche, also 3/5 von unten oder 2/5 von oben aus gemessen. Bei sitzenden Positionen, in denen sich das Hirn deutlich über Herzniveau befindet, ist aber der arterielle Druck auf Hirnhöhe wichtiger; deshalb nimmt man als Referenzhöhe (Null) den äußeren Gehörgang.</p><p>zu 5: Der arterielle Mitteldruck wird bei der invasiven Druckmessung errechnet. Falsch hohe systolische Werte (Schleuderzacken) bedingen also falsch hohe Mitteldrücke.</p><br></p>',1,1.0000000,0.3333333,'multichoice',1,'localhost:3000+190429155101+6PaoaF','localhost:3000+190429155101+Dh9uC5',0,1556553061,1556553061,4,4,NULL),(5,1,0,'Recall','<p>Welcher der folgenden Zusammenhänge beschreibt die Kenngröße \"Recall\" bei der Beurteilung eines binären Klassifikators?</p>',1,'',1,1.0000000,0.3333333,'multichoice',1,'localhost:3000+190429155522+t2MX74','localhost:3000+190429155607+HmwGmA',0,1556553322,1556553367,4,4,NULL);
/*!40000 ALTER TABLE `mdl_question` ENABLE KEYS */;
