INSERT INTO `mdl_question_attempts` VALUES (1,1,1,'deferredfeedback',2,1,1.0000000,0.0000000,1.0000000,0,'Wie ist der Lernprozess nach BRAHM & SEUFERT aufgebaut?\n\n: Leistungserbringung → Leistungsbeobachtung → Verbesserung des Lernfortschritts → Leistungsauswertung → Leistungsfeedback\n\n; Leistungsbeobachtung → Leistungserbringung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n; Leistungsbeobachtung → Leistungserbringung → Leistungsauswertung → Verbesserung des Lernfortschritts → Leistungsfeedback\n\n; Leistungserbringung → Leistungsbeobachtung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n','Leistungserbringung → Leistungsbeobachtung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n',NULL,1556028262),(2,2,1,'deferredfeedback',2,1,1.0000000,0.0000000,1.0000000,0,'Wie ist der Lernprozess nach BRAHM & SEUFERT aufgebaut?\n\n: Leistungserbringung → Leistungsbeobachtung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n; Leistungsbeobachtung → Leistungserbringung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n; Leistungsbeobachtung → Leistungserbringung → Leistungsauswertung → Verbesserung des Lernfortschritts → Leistungsfeedback\n\n; Leistungserbringung → Leistungsbeobachtung → Verbesserung des Lernfortschritts → Leistungsauswertung → Leistungsfeedback\n\n','Leistungserbringung → Leistungsbeobachtung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n',NULL,1556036173),(3,3,1,'deferredfeedback',3,1,1.0000000,0.0000000,1.0000000,0,'Laut des HICK\'S LAW steigt die Vorbereitungszeit mit steigender Anzahl an Alternativen. Welcher der folgenden mathematischen Ausdrücke beschreibt dieses Verhalten?\n\n: t = b^2 * n^2\n\n; t = b* log 2(n+1)\n\n; t = (b+1)* log 2(n)\n\n; t = log 2(b) * log 2(n)\n\n; t = b* log 2(n)\n\n','t = b* log 2(n+1)\n\n',NULL,1556552861),(4,4,1,'deferredfeedback',2,1,1.0000000,0.0000000,1.0000000,0,'Wie ist der Lernprozess nach BRAHM & SEUFERT aufgebaut?\n\n: Leistungserbringung → Leistungsbeobachtung → Verbesserung des Lernfortschritts → Leistungsauswertung → Leistungsfeedback\n\n; Leistungsbeobachtung → Leistungserbringung → Leistungsauswertung → Verbesserung des Lernfortschritts → Leistungsfeedback\n\n; Leistungserbringung → Leistungsbeobachtung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n; Leistungsbeobachtung → Leistungserbringung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n','Leistungserbringung → Leistungsbeobachtung → Leistungsauswertung → Leistungsfeedback → Verbesserung des Lernfortschritts\n\n',NULL,1556552868);
